/** @format */

import React from "react";
import {
	LineChart,
	Line,
	XAxis,
	CartesianGrid,
	Tooltip,
	ResponsiveContainer,
} from "recharts";
import styled from "styled-components";

const data = [
	{
		name: "Page A",
		uv: 4000,
		pv: 2400,
		amt: 2400,
	},
	{
		name: "Page B",
		uv: 3000,
		pv: 1398,
		amt: 2210,
	},
	{
		name: "Page C",
		uv: 2000,
		pv: 9800,
		amt: 2290,
	},
	{
		name: "Page D",
		uv: 2780,
		pv: 3908,
		amt: 2000,
	},
	{
		name: "Page E",
		uv: 1890,
		pv: 4800,
		amt: 2181,
	},
	{
		name: "Page F",
		uv: 2390,
		pv: 3800,
		amt: 2500,
	},
	{
		name: "Page G",
		uv: 3490,
		pv: 4300,
		amt: 2100,
	},
];

const Chart = () => {
	return (
		<Container>
			<Wrapper>
				<ChartTitle>User Analytics</ChartTitle>
				<ResponsiveContainer width="100%" aspect={4 / 1}>
					<LineChart data={data}>
						<XAxis dataKey="name" stroke="#5550bd" />
						<Line type="monotone" dataKey={"Active Users"} stroke="#5550bd" />
						<Tooltip />
						<CartesianGrid stroke="#e0dfdf" strokeDasharray="5 5" />
					</LineChart>
				</ResponsiveContainer>
			</Wrapper>
		</Container>
	);
};

export default Chart;

const Container = styled.div``;
const Wrapper = styled.div``;
const ChartTitle = styled.h1``;
